    private static $softbank_to_unified_ios5_keys = null;
    private static function get_softbank_to_unified_ios5_keys(){
        if(!self::$softbank_to_unified_ios5_keys){
            self::$softbank_to_unified_ios5_keys = array_keys(self::$softbank_to_unified_ios5);
        }
        return self::$softbank_to_unified_ios5_keys;
    }

    private static $unified_ios7_to_unified_ios5_keys = null;
    private static function get_unified_ios7_to_unified_ios5_keys(){
        if(!self::$unified_ios7_to_unified_ios5_keys){
            self::$unified_ios7_to_unified_ios5_keys = array_keys(self::$unified_ios7_to_unified_ios5);
        }
        return self::$unified_ios7_to_unified_ios5_keys;
    }

    private static $emoji_to_html = null;
    private static function get_emoji_to_html(){
        if(!self::$emoji_to_html){
            $arr = array();
            foreach(self::$all_emoji_info as $key => $item){
                $arr[$key] = '<span class="emoji emoji_' . $item['cate'] . ' emoji' . $item['ico'] . '"></span>';
            }
            self::$emoji_to_html = $arr;
        }
        return self::$emoji_to_html;
    }

    private static $emoji_to_img_cache_data = null;
    private static function get_emoji_to_img(){
        $params_md5 = md5(self::$single_img_url_prefix . ',' . self::$single_img_size);
        if(!isset(self::$emoji_to_img_cache_data[$params_md5])){
            $arr = array();
            foreach(self::$all_emoji_info as $key => $item){
              $arr[$key] = '<img src="' . self::$single_img_url_prefix . $item['ico'] . '.png" width="' . self::$single_img_size . '" height="' . self::$single_img_size . '">';
            }
            self::$emoji_to_img_cache_data[$params_md5] = $arr;
        }
        return self::$emoji_to_img_cache_data[$params_md5];
    }

    private static $all_emoji = null;
    private static function get_all_emoji(){
        if(!self::$all_emoji){
            self::$all_emoji = array_keys(self::$all_emoji_info);
        }
        return self::$all_emoji;
    }


    public static $is_single_img = false;
    public static $single_img_url_prefix = 'images/emoji/20_2x/';
    public static $single_img_size = 20;

    public static function softbank_to_unified_ios5($content, &$count = null){
        return str_replace(self::get_softbank_to_unified_ios5_keys(), self::$softbank_to_unified_ios5, $content, $count);
    }

    public static function unified_ios5_to_softbank($content, &$count = null){
        return str_replace(self::$softbank_to_unified_ios5, self::get_softbank_to_unified_ios5_keys(), $content, $count);
    }

    public static function unified_ios7_to_unified_ios5($content, &$count = null){
        return str_replace(self::get_unified_ios7_to_unified_ios5_keys(), self::$unified_ios7_to_unified_ios5, $content, $count);
    }

    public static function unified_ios5_to_unified_ios7($content, &$count = null){
        return str_replace(self::$unified_ios7_to_unified_ios5, self::get_unified_ios7_to_unified_ios5_keys(), $content, $count);
    }

    public static function emoji_to_html($content, $is_single_img = null, &$count = null){
        if(is_null($is_single_img)){
            $is_single_img = self::$is_single_img;
        }
        if($is_single_img){
            return str_replace(self::get_all_emoji(), self::get_emoji_to_img(), $content, $count);
        }
        return str_replace(self::get_all_emoji(), self::get_emoji_to_html(), $content, $count);
    }

    public static function remove_emoji($content, &$count = null){
        return str_replace(self::get_all_emoji(), '', $content, $count);
    }

